import { defineConfig } from 'wxt';
import react from '@vitejs/plugin-react';

// See https://wxt.dev/api/config.html
export default defineConfig({
  vite: () => ({
    plugins: [react()],
  }),
  manifest: {
    permissions: ['sidePanel', 'storage', 'tabs'],
    content_scripts: [
      {
        matches: ['<all_urls>'],
        js: ['content.ts'],
      }
    ]
  },
});
